import React from "react";

function TodoSearch ()
{
  const [searcValue, setSearchValue] = React.useState('');
  console.log(searcValue);
  
  return (
    <input 
    className="input_search" 
    placeholder="ingresar busqueda" 
    value={searcValue}
    onChange={(event)=>{
      setSearchValue(event.target.value);
    }}
    />
  );
}

export {TodoSearch};
